import React, { Fragment } from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { BrowserRouter, Route, Redirect } from "react-router-dom";
import { useCookies } from 'react-cookie';
import 'bootstrap/dist/css/bootstrap.min.css';
import './css/App.css';
import routes from './conf/routes';

function App() {

    return (
        <BrowserRouter>
        <Navbar sticky="top">


            <Container>
                <Navbar.Brand href="#home">Home</Navbar.Brand>
                {true ?
                <Navbar.Collapse className="justify-content-end">
                <Nav className="me-auto">
                    <Nav.Link href="/trends">Trends</Nav.Link>
                    <Nav.Link href="/reports">Reports</Nav.Link>
                    <Nav.Link href="/evidence">Evidence</Nav.Link>
                    <Nav.Link href="/evidence">Witness Statements</Nav.Link>
                    <Nav.Link href="/evidence">Log out</Nav.Link>
                </Nav>
                </Navbar.Collapse>
                :
                <Navbar.Collapse className="justify-content-end">
                    <Navbar.Text>Signed in as: <a href="/trends">Trends</a></Navbar.Text>
                </Navbar.Collapse>
                }
            </Container>
        </Navbar>
        <Fragment>
            {routes.map( ({ path, component, name}) => {
                return <Route exact path={path} key={name} component={component} />
            })}
        </Fragment>

        </BrowserRouter>
    );
}

export default App;
